We can all, for the most part, conceptualize what diversity looks like. I wonder how many of us- minorities included- know what diversity FEELS like. Diversity is representation at the highest level. That creates ACCESS at the bottom. Organizations and enterprises pat themselves on the back for simply looking diverse, but the truth is- diversity exists in thoughts, ideas, and culture.

I‚Äôve often been the only one in the room.
üëèThe only non-white person.
üëèThe only woman.
üëèThe only multi lingual.
üëèThe only bicultural.
üëèThe youngest.
üëèThe only one with curly hair.
In ten years- üëètheüëè onlyüëè one üëè

Here‚Äôs my take. I‚Äôm from the South. I work in oil. I‚Äôm an engineer.

I hate(d) talking about diversity in the workplace because being the only one in the room meant all eyes were on me. I felt very much like a diversity hire and there was no higher representation to suggest that I wasn‚Äôt.

So- I did what is commonly done by women and minorities; I shut out my diversity- the thoughts and ideas and culture.¬† Act like everyone else. I bonded with the guys by objectifying the (few) other women. I became aggressive! I worked my ass off, both at work, and compensating socially. No one can say nasty things about you being a diversity hire if you aren‚Äôt diverse in thoughts, ideas or culture.

In a healthy professional life, women need REPRESENTATION. If that representation is lacking- and it often is- I implore you to seek mentorship.

I‚Äôm no longer just a diverse face in the room. I‚Äôm heard, I‚Äôm empowered, and I know that my diversity- when expressed out loud- creates a representation for others. It‚Äôs so important to show up as yourself. It‚Äôs so important to retain your diversity and don‚Äôt file in line. Don‚Äôt be a diversity hire. Don‚Äôt be seen without being heard.

